package com.hualu.test.java;

import java.util.ArrayList;
import java.util.List;

public class EcgwaveTester {
	
	private static String hex = ""
+ ""
+ ""
+ "";

	private static int step = hex.length() / 7; // 1200 * 3
	private static int base = 150; // screen base/屏幕基准值
	
	public static void main(String[] args) {

		int stepIndex = 0, baseIndex = 7, dataName = 1;
//		File output = new File("D:\\output");
//		FileWriter fw = null;
		while(stepIndex < hex.length()) {
			List<int[]> list = generateArray(hex.substring(stepIndex, stepIndex + step));
			StringBuffer sb = new StringBuffer("var data" + dataName + " = [");
			for(int dataIndex = 0; dataIndex < list.size(); dataIndex++) {
				int[] data = list.get(dataIndex);
				int value = data[1];
				value += base * baseIndex;
				sb.append("[" + data[0] + "," + value + "],");
			}
			sb.deleteCharAt(sb.length() - 1);
			sb.append("];");
			System.out.println(sb.toString());			
//			try {
//				fw = new FileWriter(output);
//				fw.append(sb.toString());
//				fw.append("\r\n");
//				fw.flush();
//			} catch (IOException e) {
//				// TODO Auto-generated catch block
//				e.printStackTrace();
//			}
			stepIndex += step;
			baseIndex--;
			dataName++;
		}
//		try {
//			fw.close();
//		} catch (IOException e) {
//			e.printStackTrace();
//		}
		System.exit(0);
	}
	/**
	 * 将数据划分成2位的数组 */
	public static List<int[]> generateArray(String input) {
		List<int[]> list = new ArrayList<int[]>();
		int i = 0;
		while(i < input.length()) {
			String temp = input.substring(i, i + 2);
			int[] data = new int[2];
			data[0] = Integer.valueOf(i / 2 + 1); // x
			data[1] = Integer.valueOf(temp, 16); // y
			list.add(data);
			i += 2;
		}
		return list;
	}
}
